import '../styles/Formulaire.css'

function Formulaire(){

    const onSubmit = (e) => {
        e.preventDefault();
        const form = e.currentTarget;
        const name = form.elements.name.value;

        alert(`Submitted Name: ${name}`);
    };


    return  (<div >
        <h1>Ouvrir une session</h1>
        <div className="Container">
            <form action="" method = "post" id="form">

            <div>
                <label htmlFor="fname">Login</label>
                <input type="text" id="fname" className="fname" value = "" placeholder="Votre login.."/>
            </div>
            <div>
                <label htmlFor="lname">Mot de passe</label>
                <input type="text" id="lname" className="lname" value = "" placeholder="Votre mot de passe.."/>
            </div>

            <input type = "submit" value = "connexion "> </input>
            <input type="submit" value="Annuler"> </input>
        </form>
        </div>
    </div>
    );
}
export default Formulaire;
